trailingComments.value:
*
 * 根据书籍 ID 打开粉丝排行
 *
 * 支持平台：书旗iOS
 *
 * @return {Promise<void>}
 * @example
 *  libSQ.exec('open-fans-band', { bookId: '7522386' }).catch((err) => {
 *     alert(`[open-fans-band][error] ${JSON.stringify(err, null, 2)}`);
 *     const e = err.detail.__$rawError__;
 *     alert(e.message);
 *     alert(e.stack);
 *   });

